import React, { useState } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
import uuid from 'uuid'
import AddTask from './components/AddTask'
import Container from './components/Container'
function App() {
  const [tasks, setTasks] = useState([])
  const [task, setTask] = useState({ id: '', title: '', completed: false })
  const [title, setTitle] = useState('')
  const [completedTasks, setCompleted] = useState([])

  return (
    <div className="App">
      <AddTask tasks={tasks} setTasks={setTasks} task={task} setTask={setTask}/>
      <Container tasks={tasks} setTasks={setTasks} completedTasks={completedTasks} setCompleted={setCompleted} />
    </div>
  )
}

export default App
